B.zK=new A.h0("We modern humans benefit from monogamy a lot. Firstly, it promotes emotional health and stability for individuals by fostering trust between partners. In contrast, infidelity and multiple partners can lead to fight and divisions. According to American Psychological Association, ","20% to 40% of the divorces are caused by infidelity. ","Monogamous marriages are also optimal for the development of offspring. As opposed to male in a polyandrous marriage, monogamous male will be willing to offer more resources on children since they are sure that the child is his genetic offspring. It is ensured that both partners can devote themselves to maintaining a single family. When I was growing up, both my father and mother contributed significantly to my personal growth in different ways. My father is adventurous so he often took me out to different countries to broaden my worldview. On the other hand, my mother was meticulous and good at making plans. She helped a lot in my skill developments and college applications. Thanks for their mutual commitment to our family, I received the full support and guidance throughout my upbringing. Overall, the form of monogamous marriage has many advantages that contribute to healthier and more fulfilling relationships, both for individuals and for families.","https://www.apa.org/pubs/journals/features/cfp-0000012.pdf",null)
B.zL=new A.h0("Some marine animals can also perform a smile-like expression, like dolphins. However, dolphin smiles are widely misunderstood. Common bottlenose dolphins, for instance, appear to be smiling at people because their mouths are naturally curved. This resemblance to a human smile can lead people to feel that dolphins are always happy when meeting humans, which is not true. In the famous documentary, ","The Cove",', photographers secretly recorded how the Japanese dolphin hunting business operates. Hundreds of dolphins were killed at the cove, and the seawater was dyed red by the dolphin blood. Shockingly, some of the dead dolphins were still "smiling", despite the tragedy that had fallen on them and their families.',"https://www.opsociety.org/our-work/films/the-cove/",null)
B.zM=new A.h0("Humans were naturally polygynous. However, in the world we live in now, ","polygyny is illegal in 142 out of nearly 200 sovereign states."," We have largely adapted to monogamy. Our society has undergone dramatic changes, and monogamy may be the optimal form of marriage for humans to thrive.","https://en.wikipedia.org/wiki/Legality_of_polygamy",null)
B.zN=new A.h0("However, it is very unlikely that dolphins in the marine parks were actually happy. ","According to a report by Lauren Kearny",", wild dolphins often swim 40 to 100 miles a day, while an average dolphin tank in an aquarium is only 24 feet wide. The small room makes the dolphins frustrated and anxious. Moreover, dolphins are highly social beings, which means that they depend on their family members a lot. Being kept alone is devastating to their mental health. Nevertheless, they still look as happy as always to every tourist because their mouths are always curved like a smile.","https://www.onegreenplanet.org/animalsandnature/how-captivity-capitalizes-on-dolphin-smiles/",null)
B.zO=new A.h0("Dogs are human\u2019s best friends, and some people can find their dogs smiling adorably. However,dogs do not actually understand what is a smile. We perceive some of their facial expressions as smiling because ","some particular facial muscles"," of theirs are able to move in similar ways as ours. Then why will dogs choose to move their facial muscles so that it looks like a smile? Dogs are masters at understanding human emotions. What dogs do know is that their smiling pleases us, so the intention behind their smiling is to make us feel happy.","https://www.eurekalert.org/news-releases/947494",null)
B.zP=new A.h0("Apart from archaeological evidence, the practice of polygyny can also be observed in some existing tribes around the world. For instance, the Maasai tribe, which is found in Kenya and Tanzania, traditionally practices polygyny. Women in a polygynous marriage ","refer to other as \u201cco-wifes\u201d ","and work together to raise each other\u2019s children. This lifestyle is considered normal in their culture. Such tribes provide evidence that polygynous marriages are promoted in primitive human societies.","https://blog.siasat.pk/maasai-marriage-story/",null)
B.zQ=new A.h0("Chimpanzees also smile but in a very different way. Debbie who works at a chimpanzee sanctuary shared a surprising fact she learned when she first started working: Do not smile at chimpanzees because it is viewed as threatening behavior by them. Instead,"," do a \u201cchimpanzee\u201d smile ","by showing only your bottom teeth. Just like humans, chimpanzees rely on a lot of nonverbal cues to communicate with each other. A chimpanzee showing its top teeth is trying to intimate others while showing its bottom teeth expresses submission. The convention of chimpanzees\u2019 smiles is very different from humans.",u.t,null)
B.zR=new A.h0("Monogamy refers to a form of marriage in which a person is committed to only one partner at a time. This form of marriage is the most widespread in human societies today. However, other forms of marriage are prevalent in various animal species. Polyandry, where one male is married to multiple females, can be found ","in bee societies",". On the other hand, polygyny, where one male is married to multiple females, is common in mammal species.","https://theapiarist.org/polyandry-colony-fitness/#:~:text=Honey%20bees%20are%20polyandrous.,daughters%20are%20of%20mixed%20paternity",null)
B.zT=new A.h0("","According to Wikipedia,","there are at least 50 aquariums around the world that keep dolphins at capacity and offer tourists entertainment shows of dolphins. When I was young, I enjoyed a few dolphin shows too. I cheered for the magnificent performance of the trainers and dolphins and how coordinated they are. Watching the dolphins catching the little fish thrown by the trainer with a grin on their face, I was convinced that the dolphin must enjoy the show and the reward.","https://en.wikipedia.org/wiki/List_of_dolphinariums",null)
B.zU=new A.m2("Humans are not the only species that can form a grin. Animals like chimpanzees, dogs, and dolphins sometimes smile as well, but their meanings are often different from our smiles.",null)
B.zV=new A.m2("While early humans were naturally polygynous, modern human societies have largely adapted to monogamous marriage system due to its significant advantages in the world we are currently living in.",null)
B.zW=new A.m2("Although humans were once naturally polygynous, society development and industrialization made monogamy common. Good monogamous marriages benefit people by establishing tight family bonds and thus provide supportive environments for children to grow up. ",null)
B.zY=new A.m2("Animals other than human can also perform facial expressions that resembles a human smile. However, we must not simply view them as a sign of happiness. Just like human smiles can be genuine or fake, animal smiles are complicated and can sometimes be deceiving.",null)
